import React, { useState } from 'react';

export default function GitHubProfileFinder() {
  const [username, setUsername] = useState('');
  const [userData, setUserData] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const fetchUser = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch(`https://api.github.com/users/${username}`);
      if (!response.ok) throw new Error('Perfil não encontrado!');
      const data = await response.json();
      setUserData(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  // Estilo CSS adicional para aproximar do seu layout
  const styles = {
    container: {
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
      color: '#333'
    },
    header: {
      fontSize: '24px',
      fontWeight: 'bold',
      marginBottom: '20px',
      color: '#24292e'
    },
    searchBox: {
      display: 'flex',
      gap: '10px',
      marginBottom: '30px'
    },
    input: {
      flex: 1,
      padding: '10px 15px',
      border: '1px solid #ddd',
      borderRadius: '6px',
      fontSize: '16px'
    },
    button: {
      backgroundColor: '#2ea44f',
      color: 'white',
      border: 'none',
      padding: '10px 20px',
      borderRadius: '6px',
      cursor: 'pointer',
      fontWeight: '600',
      fontSize: '16px'
    },
    profileCard: {
      backgroundColor: '#f6f8fa',
      border: '1px solid #e1e4e8',
      borderRadius: '6px',
      padding: '20px',
      marginBottom: '20px'
    },
    profileHeader: {
      display: 'flex',
      alignItems: 'center',
      gap: '20px',
      marginBottom: '15px'
    },
    avatar: {
      width: '80px',
      height: '80px',
      borderRadius: '50%',
      border: '2px solid #e1e4e8'
    },
    profileName: {
      fontSize: '20px',
      fontWeight: '600',
      marginBottom: '5px'
    },
    profileLogin: {
      color: '#586069',
      fontSize: '16px'
    },
    profileBio: {
      margin: '15px 0',
      lineHeight: '1.5'
    },
    section: {
      backgroundColor: '#f6f8fa',
      border: '1px solid #e1e4e8',
      borderRadius: '6px',
      padding: '20px',
      marginBottom: '20px'
    },
    sectionTitle: {
      fontSize: '18px',
      fontWeight: '600',
      marginBottom: '10px',
      color: '#24292e'
    },
    sectionContent: {
      lineHeight: '1.5',
      color: '#586069'
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.header}>Perfil GitHub</h1>

      <div style={styles.searchBox}>
        <input
          type="text"
          placeholder="Digite o nome do usuário"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          style={styles.input}
          onKeyPress={(e) => e.key === 'Enter' && fetchUser()}
        />
        <button onClick={fetchUser} style={styles.button}>
          Buscar
        </button>
      </div>

      {loading && <p>Carregando...</p>}
      {error && <p style={{ color: '#cb2431' }}>{error}</p>}

      {userData && (
        <div style={styles.profileCard}>
          <div style={styles.profileHeader}>
            <img
              src={userData.avatar_url}
              alt={userData.name || userData.login}
              style={styles.avatar}
            />
            <div>
              <h2 style={styles.profileName}>{userData.name || userData.login}</h2>
              <p style={styles.profileLogin}>@{userData.login}</p>
            </div>
          </div>
          {userData.bio && <p style={styles.profileBio}>{userData.bio}</p>}
        </div>
      )}

      <div style={styles.section}>
        <h2 style={styles.sectionTitle}>Local Heroes</h2>
        <p style={styles.sectionContent}>
          Downloads local Heroes with a browser version of the Android version. This is a browser version that can be used to create local Heroes for more than 20 years.
        </p>
      </div>

      <div style={styles.section}>
        <h2 style={styles.sectionTitle}>Puffer inside ab Ghub</h2>
        <p style={styles.sectionContent}>
          Nashim perfil @ GigabitHub can see sense de models. Photo download
        </p>
      </div>
    </div>
  );
}
